import { makeStyles } from '@material-ui/core'


export default makeStyles((theme) => ({

    titleCard: {
        width: 400,
        height: 400,
        borderRadius: 50,
        boxShadow: '0 5px 40px -12px rgba(0,0,0,0.8)',

        [theme.breakpoints.down('sm')]: {
            marginTop: 30,
            width: 300,
            height: 300,

        },
        // [theme.breakpoints.down('xs')]: {
        //     height: 300,
        // },
    },
    title: {
        position: 'absolute',
        fontSize: 40,
        fontWeight: 1000,
        top: 109,
        borderRadius: 15,
        borderStyle: 'outset',
        borderColor: 'black',
        borderWidth: 6,
        paddingLeft: 30,
        paddingRight: 30,
        textTransform: 'uppercase',
        color: '#23282E',
        [theme.breakpoints.down('sm')]: {
            top: 177,
        },
        // [theme.breakpoints.down('sm')]: {
        //     fontSize: 22,
        // },
    },
    logo: {
        position: 'relative',
        width: 150,
        left: 280,
        top: 270,
        [theme.breakpoints.down('sm')]: {
            width: 112,
            left: 211,
            top: 202,
        }
    },
}))
